import classes from './css/Movie.module.css';

const Movie = props => {
    const movie = props.movie;
    return (
        <div className={classes.movie}>   
            <p>{movie.name}</p>
            <img src={movie.image} alt='movie image'></img>
        </div>
    )
}

export default Movie;
